import { Component } from "@angular/core";
import { Pacchetto } from "src/app/models/pacchetto.model";
import { Prenotazione } from "src/app/models/prenotazione.model";
import { PrenotazioneService } from "src/app/services/prenotazione.service";

@Component({
  selector: "app-prenotazione",
  templateUrl: "./prenotazione.component.html",
  styleUrls: ["./prenotazione.component.css"],
})
export class PrenotazioneComponent {
  numPartecipanti: number;
  nomeUtente: string;
  pacchetto: Pacchetto;
  convalida: boolean;

  constructor(private prenotazioneService: PrenotazioneService) {}
  onAddPrenotazione() {
    let nuovaPrenotazione: Prenotazione = new Prenotazione(
      this.numPartecipanti,
      this.nomeUtente,
      this.pacchetto,
      this.convalida
    );
    this.prenotazioneService
      .aggiungiPrenotazione(nuovaPrenotazione)
      .subscribe((data) => console.log(data));
  }
}
<div class="form">
    <form #aggiuntaPrenotazione="ngForm" (ngSubmit)="addPacchetto()">
        <label>Numero Partecipanti</label>
        <input type="number" name="numero" [(ngModel)]="numero" required>
        <label>Descrizione minima</label>
        <input type="text" name="descrizione" [(ngModel)]="descrizione" required>
        <label for="mete">Meta</label>
        <input type="text" name="meta" id="meta" [(ngModel)]="meta">
        <label>Costo</label>
        <input type="number" name="costo" [(ngModel)]="costo" required>
        <label>Disponibilità</label>
        <input type="number" name="disponibilita" [(ngModel)]="disponibilita" required>
        <label for="ass">Assicurazione</label>
        <input type="checkbox" name="assicurazione" id="ass" [(ngModel)]="assicurazione" required>
        <label for="pass">Passaporto</label>
        <input type="checkbox" name="passaporto" id="pass" [(ngModel)]="passaporto" required>
        <label for="vac">Vaccino</label>
        <input type="checkbox" name="vaccino" id="vac" [(ngModel)]="vaccino" required>
        <label>Giorno Partenza</label>
        <input type="date" name="giornoPartenza" [(ngModel)]="giornoPartenza" required>
        <label>Giorno Ritorno</label>
        <input type="date" name="giornoRitorno" [(ngModel)]="giornoRitorno" required>
        <label>Immagine</label>
        <input type="text" name="img" [(ngModel)]="img">
        <button type="submit">Aggiungi</button>
    </form>
</div>
